import Weather from '../static/images/weather.png';

export default () => (
  <Layout>
    <br/>
    <h2>Projects</h2>
    <h4>London Tech Store</h4>
    <img src="/static/images/ITPic.jpg/" alt="tech"/>
    

    
  </Layout>
)
